import React, { Component } from 'react';
import './Details.css';

export class Details extends Component {
  render() {
    return (
        <div className='details'>
            <div className='detail-list'>
                <h1>Medicine Details</h1>
            </div>
        </div>
    )
  }
}

export default Details
